#include<stdio.h>
#include<math.h>
#include<string.h>
#include<stdlib.h>
int main(){

char s[]="";
char t[]="";


int len;

if(strlen(s)>strlen(t)){
    len=strlen(s);
}
else{
    len=strlen(t);
}

for(int i=0;i<=len-1;i++){
  for(int j=i+1;j<=len;j++){
        if(s[i]!=t[j]){
            printf("%c",t[i]);
        }
    }
}

    return 0;
}